import Layout from '../components/Layout';
import PostLink from '../components/PostLink'
import Title from '../components/Title'

export default function Blog() {
  return (
    <Layout>
      <Title>Kiet Ho</Title>
      <ul>
        <PostLink title="Showcase my best projects here" />
      </ul>
    </Layout>
  );
}
